INSERT INTO `individual_consultation` VALUES (6,'## мЅ”м№­ м„ём… л¶„м„ќ ліґкі м„њ\n\n**мЅ”м№­ м„ём… мљ”м•Ѕ**\n\nліё мЅ”м№­ м„ём…мќЂ нЃґлќјмќґм–ёнЉёк°Ђ мћђм‹ м—ђкІЊ мЈјм–ґм§„ кіјм њм—ђ лЊЂн•њ л‚њмќґлЏ„м™Ђ мћ мћ¬м Ѓмќё н•ґкІ° л°©м•€м—ђ лЊЂн•ґ кі лЇјн•лЉ” кіјм •мњјлЎњ м§„н–‰лђм—€мЉµл‹€л‹¤. мЅ”м№лЉ” нЃґлќјмќґм–ёнЉёмќ кі лЇјмќ„ кІЅмІ­н•кі , л‹¤м–‘н•њ кґЂм ђм—ђм„њ л¬ём њлҐј л°”лќјліј м€ мћ€лЏ„лЎќ м§€л¬ёкіј кІ©л ¤лҐј м њкіµн–€мЉµл‹€л‹¤.\n\n---\n\n**1. мЅ”м№­ м„ём…мќ мЈјмљ” мЈјм њм™Ђ лЄ©н‘њ**\n\n*   **мЈјмљ” мЈјм њ:** н„мћ¬ м§„н–‰ м¤‘мќё кіјм њмќ м–ґл ¤м›Ђкіј к·ё н•ґкІ° л°©м•€ лЄЁмѓ‰\n*   **лЄ©н‘њ:**\n    *   нЃґлќјмќґм–ёнЉёк°Ђ м§Ѓл©ґн•њ л¬ём њмќ ліём§€мќ„ лЄ…н™•нћ€ мќґн•ґн•њл‹¤.\n    *   нЃґлќјмќґм–ёнЉёк°Ђ л¬ём њлҐј н•ґкІ°н•  м€ мћ€лЉ” л‹¤м–‘н•њ к°ЂлЉҐм„±мќ„ нѓђмѓ‰н•њл‹¤.\n    *   нЃґлќјмќґм–ёнЉём—ђкІЊ мћђм‹ к°ђмќ„ л¶Ђм—¬н•кі , мЉ¤мЉ¤лЎњ н•ґкІ°м±…мќ„ м°ѕлЏ„лЎќ лЏ•лЉ”л‹¤.\n\n---\n\n**2. л…јмќлђњ н•µм‹¬ л‚ґмљ© л°Џ л¬ём њм ђ**\n\n*   **нЃґлќјмќґм–ёнЉёмќ кі лЇј:**\n    *   н„мћ¬ м€н–‰ м¤‘мќё кіјм њк°Ђ м€мѓЃліґл‹¤ м–ґл µл‹¤кі  лЉђлЃјл©°, м–ґл–»кІЊ м‹њмћ‘н•ґм•ј н• м§Ђ, лђлЉ” мќґлЊЂлЎњ м§„н–‰н•лЉ” кІѓмќґ л§ћлЉ”м§Ђм—ђ лЊЂн•њ нјлћЂмќ„ н† лЎњн–€мЉµл‹€л‹¤. (00:00 ~ 00:05)\n    *   кіјм њмќ кІ°кіјл¬јм—ђ лЊЂн•њ л¶€м•€к°ђкіј н•Ёк», м–ґл–¤ л¶Ђл¶„мќ„ м¤‘м ђм ЃмњјлЎњ мІл¦¬н•ґм•ј н• м§Ђ лЄ…н™•н•м§Ђ м•Љл‹¤лЉ” м ђмќ„ м–ёкё‰н–€мЉµл‹€л‹¤. (00:05 ~ 00:15)\n    *   мћђм‹ мќ н„мћ¬ м ‘к·ј л°©м‹ќмќґ мµњм„ мќём§Ђ, н№мќЂ л‹¤лҐё лЌ” л‚мќЂ л°©лІ•мќґ мћ€лЉ”м§Ђм—ђ лЊЂн•њ мќкµ¬м‹¬мќ„ н‘њн„н–€мЉµл‹€л‹¤. (00:15 ~ 00:25)\n    *   кіјм њ м€н–‰ кіјм •м—ђм„њ л°њмѓќн•лЉ” мћ мћ¬м Ѓ м–ґл ¤м›Ђм—ђ лЊЂн•њ л§‰м—°н•њ л‘ђл ¤м›Ђмќ„ к°Ђм§Ђкі  мћ€м—€мЉµл‹€л‹¤. (00:25 ~ 00:35)\n\n---\n\n**3. мЅ”м№к°Ђ м њм‹њн•њ мЎ°м–ё л°Џ м†”лЈЁм…**\n\nл№„лЎќ мЃмѓЃмќ кёёмќґк°Ђ м§§м•„ мЅ”м№мќ кµ¬мІґм Ѓмќё л°њм–ёмќґ лЄ…н™•н•кІЊ л“¤л¦¬м§ЂлЉ” м•Љм§Ђл§Њ, нЃґлќјмќґм–ёнЉёмќ н‘њм •кіј л°мќ‘мќ„ н†µн•ґ л‹¤мќЊкіј к°™мќЂ мЅ”м№­ л°©м‹ќмќ„ м¶”лЎ н•  м€ мћ€мЉµл‹€л‹¤.\n\n*   **кІЅмІ­ л°Џ кіµк°ђ:** нЃґлќјмќґм–ёнЉёмќ кі лЇјкіј м–ґл ¤м›Ђмќ„ м°Ёл¶„нћ€ л“¤м–ґмЈјкі , мќґн•ґн•кі  мћ€мќЊмќ„ н‘њн„н•лЉ” м њмЉ¤мІлҐј м·Ён–€мќ„ кІѓмњјлЎњ ліґмћ…л‹€л‹¤. (м „л°м Ѓмќё мЃмѓЃм—ђм„њ нЃґлќјмќґм–ёнЉёмќ л°мќ‘мќ„ мњ лЏ„н•лЉ” лЄЁмЉµ)\n*   **м§€л¬ёмќ„ н†µн•њ нѓђмѓ‰ мњ лЏ„:** нЃґлќјмќґм–ёнЉёк°Ђ мЉ¤мЉ¤лЎњ л‹µмќ„ м°ѕлЏ„лЎќ л‹¤м–‘н•њ м§€л¬ёмќ„ лЌмЎЊмќ„ к°ЂлЉҐм„±мќґ л†’мЉµл‹€л‹¤. (00:08, 00:12, 00:15, 00:22, 00:26, 00:32, 00:39 л“± нЃґлќјмќґм–ёнЉёк°Ђ мѓќк°Ѓн•лЉ” л“Їн•њ л°мќ‘мќ„ ліґмќј л•Њ)\n*   **кёЌм •м Ѓ к°•н™” л°Џ кІ©л ¤:** нЃґлќјмќґм–ёнЉёмќ л…ёл Ґкіј к°ЂлЉҐм„±мќ„ мќём •н•кі , мћђм‹ к°ђмќ„ л¶ЃлЏ‹м•„ мЈјлЉ” л©”м‹њм§ЂлҐј м „л‹¬н–€мќ„ кІѓмњјлЎњ м€мѓЃлђ©л‹€л‹¤. (00:19 ~ 00:21, 00:36 ~ 00:43 кµ¬к°„м—ђм„њ нЃґлќјмќґм–ёнЉёмќ кёЌм •м Ѓмќё л°мќ‘)\n*   **л‹¤к°Ѓм Ѓ кґЂм ђ м њм‹њ:** н„мћ¬мќ м ‘к·ј л°©м‹ќ м™ём—ђ л‹¤лҐё м‹њк°ЃмњјлЎњ л¬ём њлҐј л°”лќјліј м€ мћ€лЏ„лЎќ мњ лЏ„н–€мќ„ к°ЂлЉҐм„±мќґ мћ€мЉµл‹€л‹¤. (00:40 ~ 00:46 кµ¬к°„мќ нЃґлќјмќґм–ёнЉёмќ \"л‹¤лҐё л°©м‹ќ\"м—ђ лЊЂн•њ кі лЇј)\n\n---\n\n**4. нЃґлќјмќґм–ёнЉёмќ л°мќ‘ л°Џ мќём‚¬мќґнЉё**\n\n*   **мґ€л°:** кіјм њм—ђ лЊЂн•њ л§‰л§‰н•Ёкіј к±±м •мЉ¤лџ¬мљґ н‘њм •мќ„ ліґмЂмЉµл‹€л‹¤. (00:00 ~ 00:05)\n*   **м¤‘л°:** мЅ”м№мќ м§€л¬ём—ђ лЊЂн•ґ мѓќк°Ѓм—ђ мћ кё°к±°л‚, кі к°њлҐј лЃ„лЌ•мќґл©° кі лЇјн•лЉ” лЄЁмЉµмќ„ ліґмЂмЉµл‹€л‹¤. (00:10 ~ 00:25)\n*   **кёЌм •м Ѓ м „н™:** мЅ”м№мќ кІ©л ¤м™Ђ м§€л¬ёмќ„ н†µн•ґ м ђм°Ё мћђм‹ к°ђмќ„ нљЊліµн•кі , кёЌм •м Ѓмќё н‘њм •мќ„ м§“кё° м‹њмћ‘н–€мЉµл‹€л‹¤. (00:36 ~ 00:43)\n*   **мѓ€лЎњмљґ кґЂм ђмќ л°њкІ¬:** мЅ”м№мќ м§€л¬ёмќ„ н†µн•ґ кё°мЎґм—ђ мѓќк°Ѓн•м§Ђ лЄ»н–€лЌ мѓ€лЎњмљґ н•ґкІ°м±…мќґл‚ м ‘к·ј л°©м‹ќмќ к°ЂлЉҐм„±мќ„ мќём‹ќн•лЉ” л“Їн•њ лЄЁмЉµмќ„ ліґмЂмЉµл‹€л‹¤. (00:40 ~ 00:46, \"л‹¤лҐё л°©м‹ќ\"м—ђ лЊЂн•њ кі лЇј)\n*   **кІ°лЎ :** м „л°м ЃмњјлЎњ мЅ”м№­ м„ём…мќ„ н†µн•ґ л¬ём њ н•ґкІ°м—ђ лЊЂн•њ мќм§ЂлҐј л‹¤м§Ђкі , кёЌм •м Ѓмќё л§€мќЊмњјлЎњ кіјм њм—ђ мћ„н•  м€ мћ€лЉ” лЏ™л Ґмќ„ м–»мќЂ кІѓмњјлЎњ ліґмћ…л‹€л‹¤.\n\n---\n\n**5. л‹¤мќЊ м„ём…мќ„ мњ„н•њ м•Ўм… м•„мќґн…њ**\n\n*   **нЃґлќјмќґм–ёнЉё:**\n    *   мќґлІ€ м„ём…м—ђм„њ м–»мќЂ мѓ€лЎњмљґ м•„мќґл””м–ґл‚ кґЂм ђмќ„ л°”нѓ•мњјлЎњ кіјм њм—ђ лЊЂн•њ кµ¬мІґм Ѓмќё м‹¤