 н„± л‹№кё°кё° л“± л‹¤м–‘н•њ ліµк·ј мљґлЏ™ лЏ™мћ‘мќ„ м—°мќґм–ґ м‹њм—°н•©л‹€л‹¤.\n    *   **н•µм‹¬ л‚ґмљ©:**\n        *   л¬ґл¦Ћмќ„ м„ёмљґ мѓЃнѓњм—ђм„њ л°њл°”л‹Ґмќ„ л°”л‹Ґм—ђ л°Ђм°©м‹њн‚¤кі  ліµк·јмќ нћмњјлЎњ мѓЃмІґлҐј л“¤м–ґ м¬л¦¬лЉ” лЏ™мћ‘мќ„ л°ліµн•©л‹€л‹¤.\n        *   нЉ№нћ€, н—€л¦¬м—ђ кіµк°„мќґ мѓќкё°м§Ђ м•ЉлЏ„лЎќ ліµк·јм—ђ нћмќ„ мЈјкі  л°”л‹Ґмќ„ кі„м†Ќ л€Њлџ¬мЈјлЉ” кІѓмќґ м¤‘мљ”н•л‹¤кі  к°•мЎ°н•©л‹€л‹¤.\n        *   л°њмќ„ л‚ґл¦ґ л•Њ л°њлЃќмќґ л°”л‹Ґм—ђ л‹їм§Ђ м•ЉлЏ„лЎќ мЈјмќн•л©°, ліµк·јмќ кёґмћҐмќ„ мњ м§Ђн•лЉ” кІѓмќґ м¤‘мљ”н•Ёмќ„ м‹њм‚¬н•©л‹€л‹¤. (00:04 - 00:49)\n    *   **л¬ём њм ђ (нЃґлќјмќґм–ёнЉёк°Ђ кІЄмќ„ м€ мћ€лЉ”):**\n        *   ліµк·јмќ нћмќґ л¶ЂмЎ±н•м—¬ н—€л¦¬м—ђ н†µм¦ќмќґ лЉђк»ґм§Ђк±°л‚, н—€л¦¬к°Ђ л°”л‹Ґм—ђм„њ л“¤л¦¬лЉ” кІЅмљ°.\n        *   лЄ©м—ђ нћмќґ л“¤м–ґк°Ђк±°л‚ м–ґк№Ёк°Ђ кёґмћҐлђлЉ” кІЅмљ°.\n        *   мљґлЏ™ м¤‘ ліµк·јмќ кёґмћҐмќ„ м њлЊЂлЎњ мњ м§Ђн•м§Ђ лЄ»н•кі  л¬ґл¦Ћмќґл‚ нЊ”м—ђ нћмќ„ м‚¬мљ©н•лЉ” кІЅмљ°. (00:37 - 00:42)\n\n*   **2. Crunch / ліµм§Ѓк·ј мѓЃл¶Ђ, м¤‘л¶Ђ**\n    *   **мЈјмљ” лЏ™мћ‘:** нЃ¬лџ°м№ (мѓЃліµл¶Ђ л°Џ м¤‘л¶Ђ ліµк·ј к°•н™”)\n    *   **н•µм‹¬ л‚ґмљ©:**\n        *   л€„мљґ мѓЃнѓњм—ђм„њ л¬ґл¦Ћмќ„ м„ёмљ°кі , мѓЃліµл¶ЂлҐј мћђк·№н•л©° мѓЃмІґлҐј л“¤м–ґ м¬л¦¬лЉ” лЏ™мћ‘мќ„ л°ліµн•©л‹€л‹¤.\n        *   ліµк·јмќ„ мҐђм–ґм§њлЉ” лЉђл‚ЊмњјлЎњ м€м¶•н•кі , л‚ґл¦ґ л•ЊлЉ” мІњмІњнћ€ ліµк·јмќ кёґмћҐмќ„ лЉђлЃјл©° л‚ґл ¤к°ЂлЉ” кІѓмќґ м¤‘мљ”н•©л‹€л‹¤.\n        *   лЁёл¦¬лҐј л„€л¬ґ л‹№кё°к±°л‚ лЄ©м—ђ л¬ґл¦¬к°Ђ к°Ђм§Ђ м•ЉлЏ„лЎќ мЈјмќн•л©°, ліµк·јмќ нћмњјлЎњ м›Ђм§Ѓмћ„мќ„ м њм–ґн•ґм•ј н•Ёмќ„ к°•мЎ°н•©л‹€л‹¤.\n        *   н—€л¦¬к°Ђ л°”л‹Ґм—ђм„њ лњЁм§Ђ м•ЉлЏ„лЎќ ліµк·јм—ђ нћмќ„ кі„м†Ќ мЈјлЉ” кІѓмќґ м¤‘мљ”н•©л‹€л‹¤. (01:09 - 02:13)\n    *   **л¬ём њм ђ (нЃґлќјмќґм–ёнЉёк°Ђ кІЄмќ„ м€ мћ€лЉ”):**\n        *   лЄ©мќґл‚ м–ґк№Ём—ђ нћмќґ л“¤м–ґк°Ђ лЄ© н†µм¦ќмќ„ мњ л°њн•лЉ” кІЅмљ°.\n        *   ліµк·јліґл‹¤ н—€л¦¬м—ђ л¬ґл¦¬к°Ђ к°ЂлЉ” кІЅмљ°.\n        *   л°лЏ™мќ„ мќґмљ©н•м—¬ лЏ™мћ‘мќ„ м€н–‰н•лЉ” кІЅмљ°.\n\n*   **3. Heel touches / ліµл¶Ђ мёЎл©ґ, м—‰лЌ©мќґм‚ґ**\n 